const PLATFORM = 'facebook_marketplace'; 
const MIN_PRICE = 1;                     
const AVG_PRICE_CAP = 5000;              

function toNumber(v) {
  if (v == null) return null;
  if (typeof v === 'number' && isFinite(v)) return v;
  if (typeof v === 'string') {
    const s = v.replace(/[^\d.,-]/g, '').replace(/,/g, '');
    const n = Number(s);
    return isFinite(n) ? n : null;
  }
  if (typeof v === 'object') {
    if (v.amount != null) return toNumber(v.amount);
    if (v.value != null) return toNumber(v.value);
  }
  return null;
}

const rows = $input.all().map(i => i.json).filter(Boolean);

const filtered = PLATFORM
  ? rows.filter(r => (r.platform || '').toLowerCase() === PLATFORM)
  : rows;

const byClient = new Map();
for (const r of filtered) {
  const key = r.client_input_id || r.client_inputs_id || r.clientId;
  if (!key) continue;
  if (!byClient.has(key)) byClient.set(key, []);
  byClient.get(key).push(r);
}

const out = [];
for (const [client_input_id, arr] of byClient.entries()) {
  const posts_count = arr.length;

  const prices = arr.map(a => toNumber(a.price))
    .filter(v => v != null && v >= MIN_PRICE);
  const avg_price = prices.length
    ? Number((prices.reduce((s, v) => s + v, 0) / prices.length).toFixed(2))
    : null;


  let score = posts_count;
  if (avg_price != null) {
    const norm = Math.min(avg_price, AVG_PRICE_CAP) / AVG_PRICE_CAP;
    score += norm; 
  }

  out.push({
    client_input_id,
    posts_count,
    avg_price,
    avg_likes: null,
    platform: PLATFORM,
    query: null,
    score,
    updated_at: new Date().toISOString()
  });
}


return out.map(j => ({ json: j }));

const MIN_PRICE = 100; 


function toNumber(v) {
  if (v == null) return null;
  if (typeof v === 'number' && isFinite(v)) return v;
  if (typeof v === 'string') {
    const n = Number(v.replace(/[^0-9.]+/g, ''));
    return isFinite(n) ? n : null;
  }
  if (typeof v === 'object') {
    if (v.amount != null) return toNumber(v.amount);
    if (v.value  != null) return toNumber(v.value);
  }
  return null;
}

const items = $input.all().map(i => i.json).filter(Boolean);


const filtered = items.filter(j => toNumber(j.listing_price?.amount ?? j.price) >= MIN_PRICE);


const out = filtered.map(j => {

  const img =
    (j.primary_listing_photo && j.primary_listing_photo.image?.url) ||
    (Array.isArray(j.listing_image) && j.listing_image.length > 0 && j.listing_image[0]?.image?.url) ||
    j.image_url ||
    null;


  const postUrl =
    j.listing_url ||
    j.listing?.url ||
    j.marketplace_listing_url ||
    j.listing?.id && `https://www.facebook.com/marketplace/item/${j.listing.id}` ||
    null;


  const title =
    j.marketplace_listing_title ||
    j.title ||
    j.custom_title ||
    null;

  const description =
    j.custom_title ||
    j.description ||
    null;


  const location =
    j.reverse_geocode?.city ||
    j.city_page?.display_name ||
    j.location ||
    null;


  const price = toNumber(j.listing_price?.amount ?? j.price);


  const seller =
    j.marketplace_listing_seller ||
    j.seller ||
    null;

  return {
    json: {
      platform: 'facebook_marketplace',
      trend_id: null,                
      title,
      description,
      price,
      location,
      image_url: img,
      post_url: postUrl,
      seller_name: seller,
      created_at: new Date().toISOString()
    }
  };
});

return out;

const src = $items("trend_posts");  


const clientInputId = $items("Get client_inputs", 0, 0)?.json?.id ?? null;
const hasKw = $items("Get a keyword", 0, 0)?.json?.has_keywords ?? null;


const out = src.map(({ json }) => ({
  json: {
    client_input_id: json.client_input_id ?? clientInputId,
    platform: json.platform ?? null,
    trend_id: json.trend_id ?? null,          
    title: json.title ?? null,
    description: json.description ?? null,
    price: json.price ?? null,
    location: json.location ?? null,           
    image_url: json.image_url ?? null,
    post_url: json.post_url ?? null,
    seller_name: json.seller_name ?? null,
    has_keywords: json.has_keywords ?? hasKw,
    is_ignored: false
  }
}));

return out;
